import React from "react";
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import { Route, Routes } from "react-router-dom";
import Home from "./Views/Home";
const MyApp = () => {
    return (
        <>
            <Routes>
                <Route path="/" Component={Home}/>
            </Routes>
        </>
    )
}

export default MyApp;
